import React from 'react';
import './styles.css'

const Title = () => {
  return (
    <section id="dashboard-title">
      <h3>Streetball Mecca</h3>
      <hr />
      <h6>An in-depth look at the public basketball courts of NYC</h6>
    </section>
  );
};

export default Title
